import React from 'react'
import {Link, useNavigate } from "react-router-dom"
import './Navb.css';


const menuList=['회사정보',"서비스","연락처","후기"]



const Navb = () => {
  return (
    <div className='menu-area'>
      <ul className='menu-list'>
        {menuList.map((menu)=><Link className='nav-link' to="/{menu}"><li>{menu}</li></Link>)}
      </ul>
    </div>
  )
}

export default Navb
